description:
An erotic masterpiece comes to life as award winning director Brad Armstrong tells the tale of Angel (jessica drake), a fallen Gregorian Angel who has been banished to earth and stripped of her wings after the accidental death of the young woman she was sent to watch over. Alone and desperate for companionship, she finds it in the city s seedy underworld, far from the idyllic heavens she once knew. Follow Angel on her dark journey through some of the most sinful and perverse places this world has to offer. As she continues her fall into darkness, she discovers a glimmer of light in Keith (Brad Armstrong), a handsome mortal that she is inexplicitly drawn to. As Keith helps guide her back towards the light, a secret from the past comes back to haunt the duo, threatening to tear them apart. Can Angel regain her wings and soar once again? Or has she fallen for the last time, doomed to live out her days trapped in the purgatory she now calls home Destined to become an adult classic, Armstrong s stunning visual style, combined with drake s top-notch performance, mind-blowing sex scenes and a screenplay that delivers till the very last frame, Fallen is an unforgettable film.

